css:
@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("filefront.com") 
{
DIV.siteMargin
{
padding: 0px !important;
}
DIV.contentArea
{
width:791px !important;
}
*
{
background-color: white !important;
color: black !important;
background-image: none !important;

}
iframe, DIV.logo, DIV.header, DIV.colLeft, UL, EMBED, H1, DIV.pathHistory, DIV[class^="GTHeadlines"], DIV.embedTblContainer, DIV[class^="postLink"], DIV.footer, DIV[class*="comment"], SPAN.h1class, DIV[class^="download"], DIV.flexColumnCont, BR, DIV#aptScreen, DIV#aptOverlay, DIV#adToHide
{
display: none !important;
}

}
